query:
-- El Dorado County EMS Agency protocols
INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'ED-100', 'Cardiac Arrest - Adult', 'Cardiac', 'El Dorado County EMS protocol for adult cardiac arrest. Initiate CPR immediately. Apply AED/defibrillator. If VF/pVT: Defibrillate 200J biphasic. Epinephrine 1mg IV/IO every 3-5 minutes. Amiodarone 300mg IV/IO first dose, 150mg second dose. Consider reversible causes (Hs and Ts).', 'https://www.edcgov.us/Government/EMS/Pages/protocols.aspx', NOW()
FROM counties c WHERE c.name = 'El Dorado County EMS Agency' AND c.state = 'California';

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'ED-101', 'Cardiac Arrest - Pediatric', 'Pediatric', 'El Dorado County pediatric cardiac arrest protocol. High-quality CPR with 15:2 ratio (2 rescuers). Defibrillation 2J/kg, increase to 4J/kg. Epinephrine 0.01mg/kg IV/IO every 3-5 minutes. Amiodarone 5mg/kg IV/IO.', 'https://www.edcgov.us/Government/EMS/Pages/protocols.aspx', NOW()
FROM counties c WHERE c.name = 'El Dorado County EMS Agency' AND c.state = 'California';

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'ED-200', 'STEMI', 'Cardiac', 'El Dorado County STEMI protocol. 12-lead ECG within 10 minutes. Aspirin 324mg PO. Nitroglycerin 0.4mg SL (if SBP>90). Activate cath lab. Transport to STEMI receiving center.', 'https://www.edcgov.us/Government/EMS/Pages/protocols.aspx', NOW()
FROM counties c WHERE c.name = 'El Dorado County EMS Agency' AND c.state = 'California';

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'ED-300', 'Stroke/CVA', 'Neurological', 'El Dorado County stroke protocol. FAST assessment. Blood glucose check. Last known well time. Transport to stroke center. Maintain SpO2 >94%. Avoid hypotension.', 'https://www.edcgov.us/Government/EMS/Pages/protocols.aspx', NOW()
FROM counties c WHERE c.name = 'El Dorado County EMS Agency' AND c.state = 'California';

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'ED-400', 'Respiratory Distress', 'Respiratory', 'El Dorado County respiratory distress protocol. Assess airway and breathing. Supplemental oxygen. Albuterol 2.5mg nebulized for bronchospasm. CPAP for CHF/pulmonary edema. Consider advanced airway if needed.', 'https://www.edcgov.us/Government/EMS/Pages/protocols.aspx', NOW()
FROM counties c WHERE c.name = 'El Dorado County EMS Agency' AND c.state = 'California';

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'ED-500', 'Trauma - Major', 'Trauma', 'El Dorado County major trauma protocol. C-spine precautions. Control hemorrhage with direct pressure and tourniquets. IV access. Fluid resuscitation. Transport to trauma center.', 'https://www.edcgov.us/Government/EMS/Pages/protocols.aspx', NOW()
FROM counties c WHERE c.name = 'El Dorado County EMS Agency' AND c.state = 'California';

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'ED-600', 'Opioid Overdose', 'Toxicology', 'El Dorado County opioid overdose protocol. Assess responsiveness and breathing. Naloxone 2mg IN or 0.4mg IV/IM. Repeat every 2-3 minutes as needed. Ventilatory support.', 'https://www.edcgov.us/Government/EMS/Pages/protocols.aspx', NOW()
FROM counties c WHERE c.name = 'El Dorado County EMS Agency' AND c.state = 'California';

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'ED-700', 'Anaphylaxis', 'Medical', 'El Dorado County anaphylaxis protocol. Epinephrine 0.3mg IM (adult), 0.15mg IM (pediatric). Diphenhydramine 25-50mg IV/IM. Albuterol for bronchospasm. IV fluid bolus for hypotension.', 'https://www.edcgov.us/Government/EMS/Pages/protocols.aspx', NOW()
FROM counties c WHERE c.name = 'El Dorado County EMS Agency' AND c.state = 'California';

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'ED-800', 'Seizure', 'Neurological', 'El Dorado County seizure protocol. Protect patient from injury. Midazolam 5mg IM/IN for status epilepticus. Check blood glucose. Post-ictal care and monitoring.', 'https://www.edcgov.us/Government/EMS/Pages/protocols.aspx', NOW()
FROM counties c WHERE c.name = 'El Dorado County EMS Agency' AND c.state = 'California';

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'ED-900', 'Hypoglycemia', 'Medical', 'El Dorado County hypoglycemia protocol. Blood glucose <60mg/dL. Dextrose 25g IV (D50) or Glucagon 1mg IM if no IV access. Oral glucose if patient can swallow.', 'https://www.edcgov.us/Government/EMS/Pages/protocols.aspx', NOW()
FROM counties c WHERE c.name = 'El Dorado County EMS Agency' AND c.state = 'California';

